import React from 'react';
import {
    HashRouter,
    Route,
    Switch 
} from 'react-router-dom';


import ASide from '../Aside/Aside';
import Sidebar from '../Sidebar/Sidebar';
import Employe from '../../pages/Employe/Employe';
import Conge from '../../pages/Conge/Conge'

const Content = (props) => {
    return(
        <HashRouter>
            
            <div className="container">
                <Sidebar />
                <Switch>
                    <Route path="/employe" component={Employe} />
                    <Route path="/conges" component={Conge} />
                </Switch>
                <ASide />
            </div>
        </HashRouter>
    )
}

export default Content;
